import React, { Component } from 'react';
import { Link } from "react-router-dom";
import Cookies from 'universal-cookie';
import axios from 'axios';

import { Navbar, Container, Nav } from "react-bootstrap";
import styles from "../css/Navbar.module.css";
import logo from "../assets/imgs/logo.png";

const cookies = new Cookies();

class NavBar extends Component {

  logout = () => {
    cookies.remove('id', { path: '/' });
    cookies.remove('last_login', { path: '/' });
    cookies.remove('is_superuser', { path: '/' });
    cookies.remove('username', { path: '/' });
    cookies.remove('email', { path: '/' });
    cookies.remove('first_name', { path: '/' });
    cookies.remove('last_name', { path: '/' });
    cookies.remove('full_name', { path: '/' });
    cookies.remove('birthday', { path: '/' });
    cookies.remove('gender', { path: '/' });
    cookies.remove('verification_code', { path: '/' });
    cookies.remove('is_staff', { path: '/' });
    cookies.remove('is_active', { path: '/' });
    cookies.remove('date_joined', { path: '/' });
    cookies.remove('updated', { path: '/' });
    cookies.remove('order', { path: '/' });
    cookies.remove('age', { path: '/' });
    cookies.remove('groups', { path: '/' });
    cookies.remove('user_permissions', { path: '/' });

    window.location.href = './';
  };

  componentDidMount() {
    let config = {
      headers: {
        Authorization: 'Token ' + cookies.get('token'),
      }
    }
    axios.get('http://127.0.0.1:8000/api/user/', config)
      .then(response => {
        console.log(response.data);
      })
    if (!cookies.get('email')) {
      window.location.href = './';
    }
  };

  render() {
    return (
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark" className={styles.navbar}>
        <Container>
          <Link to={"/homepage"}>
            <Navbar.Brand>
              <img src={logo} alt="logotype" />
              Encora
            </Navbar.Brand>
          </Link>
          <Navbar.Text className="justify-items-center">Welcome {cookies.get('first_name')}</Navbar.Text>

          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              {cookies.get('is_superuser') === true ? (
                <Link to={"/admin"} className={styles.navbar_target}>
                  Admin
                </Link>
              ) : null}
            </Nav>
            <Nav>
              <Link className={styles.navbar_target} to={"/homepage"}>
                Home
              </Link>
              <Link className={styles.navbar_target} to={"/myreservations"}>
                My bookings
              </Link>
              {/* <li>
                <Nav.Link className="btn btn-default btn-outline btn-circle collapsed" data-toggle="collapse" href="#nav-collapse3" aria-expanded="false" aria-controls="nav-collapse3">
                  Logout
                </Nav.Link>
              </li>
              <div className="collapse nav navbar-nav nav-collapse slide-down" id="nav-collapse3">
                <form className="navbar-form navbar-right" role="logout">
                  <div className="form-group">
                    <input type="text" className="form-control" placeholder="Logout" />
                  </div>
                  <button type="submit" className="btn btn-danger"><span className="glyphicon glyphicon-search" aria-hidden="true"></span></button>
                </form>
              </div> */}


              <li>
                <a className="btn btn-default btn-outline btn-circle collapsed" data-toggle="collapse" href="#nav-collapse3" aria-expanded="false" aria-controls="nav-collapse3" to={'/'} onClick={() => this.logout(true)}>
                  Logout
                </a>
              </li>
            </Nav>
          </Navbar.Collapse>
        </Container >
      </Navbar >
    );
  };
}

export default NavBar;
